import React, { useState } from 'react'
import imgl from '../asset/img/dashboard.jpg'
import { Link, useNavigate } from 'react-router-dom'

function Homepage() {
  const navigate = useNavigate();
  const [inputs, setInputs] = useState({})
  const [showerror, setshowerror] = useState(false)
  const handleChange = (event) => {
    const name = event.target.name;
    const value = event.target.value;
    setInputs(values => ({ ...values, [name]: value }))
  }

  const dologin = (event) => {
    event.preventDefault();

    console.log("Clicked", inputs);
    if (inputs.pass.length >= 8) {

      navigate('/Dashboard');
    }

    else {
      setshowerror(true);
    }
  }
  return (
    <div className='container'>
      <div className='leftcontainer'>
        <p>Welcome to expense tracker</p>
        <p>Manage all your expense here</p>
        <img src={imgl} />
      </div>


      <div className='rightcontainer'>
        <div className='formcard'>
          <div>
            <center><h2>Login</h2></center>
          </div>
          <form onSubmit={dologin}>
            <div>
              <label>
                Email
              </label>

              <input
                required
                type="email"
                placeholder='enter your email'
                value={inputs.email || ''}
                onChange={handleChange}
                name='email'
              />
            </div>
            <div>
              <label>
                Password
              </label>

              <input
                required
                type="password"
                placeholder='enter Passward'
                value={inputs.pass || ''}
                onChange={handleChange}
                name='pass'
              />
            </div>
            {
              showerror ? 
                <div>
                  <span style={{ color: 'red', alignSelf: 'center' }}>password length must be greater than 8 </span>
                </div>: null
            }
            <div>
              <button >Login</button>
            </div>
            </form>
            <div>
              <button onClick={() => { alert("Email Sent")}} style={{backgroundColor:'white',color:'black',border:'2px solid black'}}>Forget Passward</button>
              </div>
              <div>
              <span style={{ alignSelf: 'center' }}>not a user?<Link to="/Register">Register</Link> </span>
             
            </div>
          
        </div>




      </div>
    </div>
  )
}

export default Homepage
